import css from './Counter.module.css'

function Counter () {
    return (  
        <div className={css.container}>
            <button className={css.btn} type="button">+</button>
            <p className={css.value}>0</p>
            <button className={css.btn} type="button">-</button>
        </div>
    );
}

export default Counter ;
